          <img alt='e-health' className='photo2' src='images/bw-p2.jpeg' />
          <p class="text2">E-HEALTH</p>
        </div> */}
      </div>
      <div class="line3"></div>
      <div class="line4"></div>
    </div>
  );
}

export default Hero;
